import axios from "axios";
import { useEffect, useState } from "react";
import { useLocation } from "react-router";

let currentPath = "";

const PostTable = (props) => {

    const url = "http://localhost:8080"

    const [postList, setPostList] = useState([]);
    const urlParams = new URLSearchParams(window.location.search)
    let location = useLocation();

    useEffect(() => {


        if (props.keyWord.length === 0) {
            axios.get(`${url}/post/list`)
                .then((res) => {
                    setPostList(res.data);
                    console.log(res)
                })
                .catch((err) => {
                    console.log(err)
                })
        }
        else {
            axios.get(`${url}/post/search?keyWord=${urlParams.get("keyWord")}`)
                .then((res) => {
                    setPostList(res.data);

                })
                .catch((err) => {
                    console.log(err);
                })
        }


    }, [location])

    const trClickEvent = (no) => {

        window.location.href = `/post?no=${no}`;

    }

    return (
        <table>
            <thead>
                <tr>
                    <th>번호</th>
                    <th>제목</th>
                    <th>작성자</th>
                </tr>

            </thead>
            <tbody>
                {
                    postList.map((value, index) => {
                        console.log(value.userDto.nickName)
                        let nickName = value.userDto.nickName;
                        return (
                            <tr key={index} onClick={() => { trClickEvent(value.no) }}>
                                <td>{value.no}</td>
                                <td>{value.title}</td>
                                <td>{nickName}</td>
                            </tr>
                        )
                    })
                }
            </tbody>

        </table>
    )


    return (
        <div class="flex flex-col">
            <div class="overflow-x-auto sm:-mx-6 lg:-mx-8">
                <div class="inline-block min-w-full py-2 sm:px-6 lg:px-8">
                    <div class="overflow-hidden">
                        <table
                            class="min-w-full text-left text-sm font-light text-surface dark:text-white">
                            <thead
                                class="border-b border-neutral-200 font-medium dark:border-white/10">
                                <tr>
                                    <th scope="col" class="px-6 py-4">번호</th>
                                    <th scope="col" class="px-6 py-4">제목</th>
                                    <th scope="col" class="px-6 py-4">작성자</th>
                                </tr>
                            </thead>
                            <tbody>
                                <tr
                                    class="border-b border-neutral-200 transition duration-300 ease-in-out hover:bg-neutral-100 dark:border-white/10 dark:hover:bg-neutral-600">
                                    <td class="whitespace-nowrap px-6 py-4 font-medium">1</td>
                                    <td class="whitespace-nowrap px-6 py-4">Mark</td>
                                    <td class="whitespace-nowrap px-6 py-4">Otto</td>
                                    <td class="whitespace-nowrap px-6 py-4">@mdo</td>
                                </tr>
                                <tr
                                    class="border-b border-neutral-200 transition duration-300 ease-in-out hover:bg-neutral-100 dark:border-white/10 dark:hover:bg-neutral-600">
                                    <td class="whitespace-nowrap px-6 py-4 font-medium">2</td>
                                    <td class="whitespace-nowrap px-6 py-4">Jacob</td>
                                    <td class="whitespace-nowrap px-6 py-4">Thornton</td>
                                    <td class="whitespace-nowrap px-6 py-4">@fat</td>
                                </tr>
                                <tr
                                    class="border-b border-neutral-200 transition duration-300 ease-in-out hover:bg-neutral-100 dark:border-white/10 dark:hover:bg-neutral-600">
                                    <td class="whitespace-nowrap px-6 py-4 font-medium">3</td>
                                    <td class="whitespace-nowrap px-6 py-4">Larry</td>
                                    <td class="whitespace-nowrap px-6 py-4">Wild</td>
                                    <td class="whitespace-nowrap px-6 py-4">@twitter</td>
                                </tr>
                            </tbody>
                        </table>
                    </div>
                </div>
            </div>
        </div>
    )
}

export default PostTable;
